window.bookSummaryJSON = "<p><b>It’s been almost a year since the Trials of Unyielding Steel.</b></p> <p>When Lydia gets a lead on the whereabouts of Jonathan Sterling, she concludes her training with a legendary immortal sorcerer and puts a plan in motion for his capture.&nbsp;</p> <p>Near Selyr, Taelien reunites with an old friend - Wrynn Jaden, the legendary Witch of a Thousand Shadows - and meets with Jonan to make a deal.&nbsp;</p> <p>Jonan, of course, has other concerns. His master, the legendary Lady of Thieves herself, has given him a new assignment - one that hints at world-shaping events, if he can survive the mission. He’ll partner with Velas, but she has her own problems to deal with, including a revelation that will test where her loyalties truly lie.</p>"; 
